import './App.css';
import Map from "mapmyindia-react";
import React from 'react';
import {lat1,long1} from './location.js';
var lat,long;

setTimeout(function(){App.forceUpdate();}, 5000);
  function App() {
    function get(){
      lat=lat1;
      long=long1;
      console.log('lat='+lat+" long="+long);
      return 1;
    }
    if(get()){
      return (
        <Map
          markers={[
              { 
                  position: [ parseFloat(lat) , parseFloat(long)],
                  draggable: true, 
                  title:"I am here",
                  onClick: e => {
                      console.log("clicked ");
                  },
                  onDragend: e => {
                      console.log("dragged");
                  }
              }
          ]}
          />
     );
        }


  }

export default App;
